	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 421px; min-height: 296px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 411px; min-height: 286px;\"><p style=\"line-height: 1.25; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:12pt; font-family: Arial, sans-serif; color: rgb(51, 51, 51);\">Ø-merket er det offisielle norske økologimerket. Merkeordningen administreres av Debio, den norske godkjenningsinstansen for økologisk produksjon. Ø-merket gir en garanti for at en vare er økologisk dyrket. Det innebærer blant annet at det ikke brukes kunstgjødsel eller syntetiske sprøytemidler i produksjonen, og krav til dyrevelferd som er strengere enn i konvensjonelt landbruk. Ø-merket stiller også strenge krav til tilsetningsstoffer (E-stoffer). For at et produkt skal kunne Ø-merkes, må minst 95 prosent av ingrediensene være økologiske. Merket brukes først og fremst på mat og drikke, men brukes også på landbruksprodukter (gjødsel, såvarer mm), tekstiler og kosmetikk. For mer informasjon, se <a id=\"triv1971\" href=\"javascript:hyperlink1971()\" style=\"cursor: pointer;\"><span style=\"text-decoration: underline; color:#0000FF;\"><u>her.</u></span></a></span></p></div></div>",
